import React from "react";
import "./App.css";
import Header from "./Header";
import Home from "./Home";
import {BrowserRouter as Router, Switch , Route } from "react-router-dom";


function App() {
  return (
    <Router>
    <div className="App">
      <Switch>
        <Route path="checkout">
          <Header />
          <Checkout />
        </Route>
        {/* Make sure lev the root route in the bottom(last) for all */}
        <Route path="/">
          <Header />
          <Home />
        </Route>
      </Switch>
    </div>
    </Router>
  );
}

export default App;
